import React from 'react'
import { UserNav } from '../../component/Navbar/homeNav'
import { useEffect } from 'react';
import OnBoarding from '../../SmartContracts/OnBoarding/OnBoarding';
import { useState } from 'react';

export default function MyMaterials() {

  const [materialsList,SetMaterialsList]=useState([])

  let result="prova"



  useEffect(()=>{
    async function getMaterials(){
      const onboarding = new OnBoarding();
      var mats = await onboarding.getMaterials();
      console.log(mats)
       result = mats.map((value,key)=>{
  
        return(<tr key={key}>
                <td key={value.name}>{value.name}</td>
                <td key={value.materiale}>{value.materiale}</td>
                <td key={value.color}>{value.color}</td>
                <td key={value.quantityKG}>{value.quantityKG}</td>
                <td key={value.printTemp}>{value.printTemp}</td>
                <td key={value.bedTemperature}>{value.bedTemperature}</td>
        </tr>)
  
      })
      console.log(result)
      SetMaterialsList(result)
    }
    getMaterials();
  },[])

  return (
    <div>
        <div className='sign'>
        <UserNav/>
        <h1>My Materials</h1>
        
        <table className='myPrinters'>

          <tbody>
            <tr>
              <th>name</th>
              <th>Type</th>
              <th>Color</th>
              <th>quantityKG</th>
              <th>Print Temp</th>
              <th>Bed Temp</th>
            </tr>
            {materialsList}
          </tbody>
        </table>
        </div>

    </div>
  )
}
